import React from "react";
import {Link} from "react-router-dom";
import { SentenceToChunk, SizeOfChunk } from "./InputTools";

const Practice = () => (
    <div>
        <SentenceToChunk />
        <SizeOfChunk />
        <button>OK</button>
        <Link to = "/">
            <button>Cancel</button>
        </Link>
    </div>
);

export default Practice;
